description:
Category	Feature, Plot Based

Director	Andrej Lupin
Starring	Suzie Carina, Candy Sweet, Lucy Li, Paula Shy

SUZIE CARINA: wealthy woman, home owner and superb organizer. This lady likes everything just so and she needs her house workers just perfect.
Suzie's agents have lined up a great selection of girls to cater to her every need, but not all of them will make the grade.
Dig deep into DOMESTIC DESIRE and follow Suzie and her helper's most intimate passions. This is the only Andrej Lupin video.

